import React from 'react';
//import './index.css';
import { PieChart, Pie, Cell } from 'recharts';
import TestCode from "./testcode";
import axios from 'axios';

class StageOnelbgroup extends React.Component {

  state = {
    group: '',
    NPU: '',
    maxEntries: null,
    usedEntries: null,
    percentUsage: null,
    color: '',
    datapoints: []
  }


  componentDidMount = () => {
    this.getData();
  };


  getData = () => {
    axios.get('//localhost:8080/api')
      .then((response) => {
        const data = response.data;
        this.setState({ datapoints: data });
        console.log('Data retrieved!');
      })
      .catch(() => {
        alert('Error retrieving data!!!');
      });
  }

  render() {

    let getGroup = this.state.datapoints.map(
      (el) => {
        return el.group
      }
    )

    let getNPU = this.state.datapoints.map(
      (el) => {
        return el.NPU
      }
    )

    let getMaxEntries = this.state.datapoints.map(
      (el) => {
        return el.maxEntries
      }
    )

    let getUsedEntries = this.state.datapoints.map(
      (el) => {
        return el.usedEntries
      }
    )

    let getPercentUsage = this.state.datapoints.map(
      (el) => {
        return el.percentUsage
      }
    )

    let getColor = this.state.datapoints.map(
      (el) => {
        return el.getColor
      }
    )

    // const routerInfoList = [
    //   { type: {getGroup}, maxEntries: {getMaxEntries}, usedEntries: 3000, percentUsage: null, color: '' },
    //   { type: "NPU-1", maxEntries: 16384, usedEntries: 15000, percentUsage: null, color: '' },
    //   { type: "NPU-2", maxEntries: 16384, usedEntries: 16000, percentUsage: null, color: '' },
    // ];

    for (let i = 0; i < 3; i++) {
      getPercentUsage = (getUsedEntries/getMaxEntries)*100;
    }


    for (let i = 0; i < 3; i++) {
      if (getPercentUsage >= 95) {
        getColor = "red";
      }
      if (getPercentUsage >= 80 && getPercentUsage < 95) {
	      getColor = "yellow";
      }
      if (getPercentUsage >= 0 && getPercentUsage < 80) {
        getColor = "green";
      }
    }

    const NPU0data = [
      { name: "Used", value: getPercentUsage },
      { name: "Empty", value: 100-getPercentUsage}
    ];
    const NPU1data = [
      { name: "Used", value: getPercentUsage },
      { name: "Empty", value: 100-getPercentUsage}
    ];
    const NPU2data = [
      { name: "Used", value: getPercentUsage },
      { name: "Empty", value: 100-getPercentUsage}
    ];

    // const routerInfoList = [
    //   { type: "NPU-0", maxEntries: 16384, usedEntries: 3000, percentUsage: null, color: '' },
    //   { type: "NPU-1", maxEntries: 16384, usedEntries: 15000, percentUsage: null, color: '' },
    //   { type: "NPU-2", maxEntries: 16384, usedEntries: 16000, percentUsage: null, color: '' },
    // ];

    // for (let i = 0; i < routerInfoList.length; i++) {
    //   routerInfoList[i].percentUsage = (routerInfoList[i].usedEntries/routerInfoList[i].maxEntries)*100;
    // }


    // for (let i = 0; i < routerInfoList.length; i++) {
    //   if (routerInfoList[i].percentUsage >= 95) {
    //     routerInfoList[i].color = "red";
    //   }
    //   if (routerInfoList[i].percentUsage >= 80 && routerInfoList[i].percentUsage < 95) {
	  //     routerInfoList[i].color = "yellow";
    //   }
    //   if (routerInfoList[i].percentUsage >= 0 && routerInfoList[i].percentUsage< 80) {
    //     routerInfoList[i].color = "green";
    //   }
    // }


    const COLORS = ['red', 'green'];

    const RADIAN = Math.PI / 180;
    const renderCustomizedLabel = ({ cx, cy, midAngle, innerRadius, outerRadius, percent, index }) => {
      const radius = innerRadius + (outerRadius - innerRadius) * 0.5;
      const x = cx + radius * Math.cos(-midAngle * RADIAN);
      const y = cy + radius * Math.sin(-midAngle * RADIAN);

      return (
        <text x={x} y={y} fill="white" textAnchor={x > cx ? 'start' : 'end'} dominantBaseline="central">
          {`${(percent * 100).toFixed(0)}%`}
        </text>
      );
    };

    // const NPU0data = [
    //   { name: "Used", value: routerInfoList[0].percentUsage },
    //   { name: "Empty", value: 100-routerInfoList[0].percentUsage}
    // ];
    // const NPU1data = [
    //   { name: "Used", value: routerInfoList[1].percentUsage },
    //   { name: "Empty", value: 100-routerInfoList[1].percentUsage}
    // ];
    // const NPU2data = [
    //   { name: "Used", value: routerInfoList[2].percentUsage },
    //   { name: "Empty", value: 100-routerInfoList[2].percentUsage}
    // ];



    return (
      <div>
        <TestCode />
        <div style={ { 'textAlign': 'center' } }>
          <h1>stage1_lb_group</h1>
          <h2>NPU-0</h2>
          <PieChart width={window.innerWidth} height={400}>
          <Pie
            data={NPU0data}
            cx="50%"
            cy="50%"
            labelLine={false}
            label={renderCustomizedLabel}
            outerRadius={200}
            fill="#8884d8"
            dataKey="value"
          >
            {NPU0data.map((entry, index) => (
              <Cell key={`cell-${index}`} fill={COLORS[index % COLORS.length]} />
            ))}
          </Pie>
        </PieChart>
          <p>Usage State: {getColor}</p>
          <p>There are {getUsedEntries} out of {getMaxEntries} items used.</p>
          <h2>NPU-1</h2>
          <PieChart width={window.innerWidth} height={400}>
          <Pie
            data={NPU1data}
            cx="50%"
            cy="50%"
            labelLine={false}
            label={renderCustomizedLabel}
            outerRadius={200}
            fill="#8884d8"
            dataKey="value"
          >
            {NPU1data.map((entry, index) => (
              <Cell key={`cell-${index}`} fill={COLORS[index % COLORS.length]} />
            ))}
          </Pie>
        </PieChart>
          <p>Usage State: {getColor}</p>
          <p>There are {getUsedEntries} out of {getMaxEntries} items used.</p>
          <h2>NPU-2</h2>
          <PieChart width={window.innerWidth} height={400}>
          <Pie
            data={NPU2data}
            cx="50%"
            cy="50%"
            labelLine={false}
            label={renderCustomizedLabel}
            outerRadius={200}
            fill="#8884d8"
            dataKey="value"
          >
            {NPU2data.map((entry, index) => (
              <Cell key={`cell-${index}`} fill={COLORS[index % COLORS.length]} />
            ))}
          </Pie>
        </PieChart>
          <p>Usage State: {getColor}</p>
          <p>There are {getUsedEntries} out of {getMaxEntries} items used.</p>
        </div>
        <div></div>

      </div>
    )
  }
}

export default StageOnelbgroup;
